import React from 'react';
import s from './Cart.module.css';

const Cart = (props) => {
  return (
    <div>
      <div>
        <span></span>
        <span></span>
      </div>
      <div>
        <button>Закрыть</button>
        <button>Заказать</button>
      </div>
    </div>
  );
};

export default Cart;
